<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <link
      rel="stylesheet"
      href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.1.1/css/all.min.css"
      integrity="sha512-KfkfwYDsLkIlwQp6LFnl8zNdLGxu9YAA1QvwINks4PhcElQSvqcyVLLD9aMhXd13uQjoXtEKNosOWaZqXgel0g=="
      crossorigin="anonymous"
      referrerpolicy="no-referrer"
    />
    <title>zep-widget</title>
    <style>
      html,
      body,
      div,
      span,
      applet,
      object,
      iframe,
      h1,
      h2,
      h3,
      h4,
      h5,
      h6,
      p,
      blockquote,
      pre,
      a,
      abbr,
      acronym,
      address,
      big,
      cite,
      code,
      del,
      dfn,
      em,
      img,
      ins,
      kbd,
      q,
      s,
      samp,
      small,
      strike,
      strong,
      sub,
      sup,
      tt,
      var,
      b,
      u,
      i,
      center,
      dl,
      dt,
      dd,
      ol,
      ul,
      li,
      fieldset,
      form,
      label,
      legend,
      table,
      caption,
      tbody,
      tfoot,
      thead,
      tr,
      th,
      td,
      article,
      aside,
      canvas,
      details,
      embed,
      figure,
      figcaption,
      footer,
      header,
      hgroup,
      menu,
      nav,
      output,
      ruby,
      section,
      summary,
      time,
      mark,
      audio,
      video {
        margin: 0;
        padding: 0;
        border: 0;
        font-size: 100%;
        font: inherit;
        vertical-align: baseline;
      }
      article,
      aside,
      details,
      figcaption,
      figure,
      footer,
      header,
      hgroup,
      menu,
      nav,
      section {
        display: block;
      }
      body {
        line-height: 1;
      }
      ol,
      ul {
        list-style: none;
      }
      blockquote,
      q {
        quotes: none;
      }
      blockquote:before,
      blockquote:after,
      q:before,
      q:after {
        content: "";
        content: none;
      }
      table {
        border-collapse: collapse;
        border-spacing: 0;
      }
      @font-face {
        font-family: "BM Euljiro 10 years later";
        src: url(./BMEuljiro10yearslater.otf) format("opentype");
      }
      @font-face {
        font-family: BM Kirang Haerang;
        src: url(./BMKIRANGHAERANG.otf) format("opentype");
      }
      *,
      div {
        box-sizing: border-box;
      }
      .container {
        position: relative;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        width: 100vw;
        height: 100vh;
      }
      .bg-image {
        position: absolute;
        left: 0;
        top: 0;
        width: 100%;
        height: 100%;
        z-index: -1;
      }
      .result-backdrop {
        position: absolute;
        left: 0;
        top: 0;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        width: 100%;
        height: 100%;
        backdrop-filter: blur(5px);
      }
      .textWrapper {
        display: flex;
        justify-content: center;
        align-items: center;
        position: absolute;
        top: 80px;
        width: 70%;
        height: 260px;
        box-sizing: border-box;
      }
      .text {
        font-size: 35px;
        font-family: BM Kirang Haerang, -apple-system, BlinkMacSystemFont,
          Segoe UI, Roboto, Oxygen, Ubuntu, Cantarell, Open Sans, Helvetica Neue,
          sans-serif;
        line-height: 60px;
        color: #000;
        text-align: center;
        word-break: keep-all;
      }
      .red-text {
        color: #c00000;
      }
      .button-box {
        display: flex;
        flex-wrap: wrap;
        align-items: center;
        justify-content: center;
        column-gap: 20px;
        row-gap: 10px;
        width: 100%;
        margin-top: 0;
      }
      .button {
        display: inline-flex;
        position: relative;
        align-items: center;
        width: 490px;
        height: 180px;
        cursor: pointer;
        font-size: 35px;
        font-family: "BM Euljiro 10 years later", -apple-system,
          BlinkMacSystemFont, Segoe UI, Roboto, Oxygen, Ubuntu, Cantarell,
          Open Sans, Helvetica Neue, sans-serif;
        color: #000;
        box-sizing: border-box;
        padding-top: 56px;
        padding-left: 20px;
        padding-bottom: 30px;
      }
      .button span {
        box-sizing: border-box;
        text-align: center;
        width: 90%;
        height: fit-content;
        max-height: 70%;
      }
      .button-image {
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        z-index: -1;
      }
      .incorrect {
        font-size: 80px;
        font-family: BM Kirang Haerang, -apple-system, BlinkMacSystemFont,
          Segoe UI, Roboto, Oxygen, Ubuntu, Cantarell, Open Sans, Helvetica Neue,
          sans-serif;
        color: #c00000;
      }
      .correct-circle {
        width: 600px;
        height: 600px;
        border-radius: 50%;
        background-color: transparent;
        border: 20px solid #c00000;
      }
      .header {
        display: flex;
        justify-content: flex-end;
        width: 1024px;
        height: 20px;
        padding-right: 20px;
        background-color: #fff;
      }
      .main {
        width: 1024px;
        height: 768px;
        position: relative;
        overflow: hidden;
        display: flex;
        flex-direction: column;
        justify-content: end;
        padding-bottom: 20px;
        align-items: center;
        box-sizing: border-box;
      }
    </style>
  </head>
